@igbconline organized an Awareness Session on Green Healthcare Facilities at, Pune on 28th April 2017. The event witnessed participation from over 70 stakeholders which included #Doctors, #Architects, #Hospital #Administrators, Product #Manufacturers, #MEP #Consultants etc.
The healthcare sector in India is growing at a rapid pace and contributing immensely to the growth of service sector. There is an imminent need to introduce green concepts which can aid growth in a sustainable manner.
We thank our special dignitaries who attended the event – Ar. Poorva Keskar, Dr. Vivek Desai, Dr. Shona Nag, Mr. Hemant Rathod, Mr. Bharat Kris rao, Ar. Sandeep Shikre
